pragma solidity ^0.6.8;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";

import "./BaseMixin.sol";
import "./interfaces/IExecutable.sol";
import "./interfaces/IAuthorizable.sol";

abstract contract Executable is BaseMixin, IExecutable {
    using SafeERC20 for IERC20;

    struct ERC20Approval {
        address token;
        address spender;
    }
    ERC20Approval[] internal _approvals;

    function _initialize() internal virtual {
        _storage.setSigningRequirements(this.execute.selector, true, 0);

        bytes4[] memory dependencies = new bytes4[](2);
        dependencies[0] = IAuthorizable.transferOwnership.selector;
        _storage.setSecurityPeriod(this.execute.selector, 24 hours, dependencies);
    }

    /**
     * @notice Executes arbitrary contract functions
     * If 'ERC20.approve()'s were called in the batched executions,
     * then all the amounts of the approved tokens need to be spent by the end of the call
     *
     * @param targets contract addresses to be executed for each execution
     * @param values amount of ETH for each execution
     * @param data methodID + args for each execution
     */
    function execute(
        address[] memory targets,
        uint256[] memory values,
        bytes[] memory data,
        Storage.Signatures memory signatures
    ) public override payable whenInitialized whenNotLocked returns (bytes[] memory) {
        require(
            targets.length == values.length && values.length == data.length,
            "different-params-length"
        );
        _ensureSecurityPeriodPassed(this.execute.selector);
        _ensureSignaturesValid(
            this.execute.selector,
            executeHash(targets, values, data),
            signatures
        );

        _storage.incrementNonce();
        _storage.updateLastExecutionTime(this.execute.selector);

        bytes[] memory returned = new bytes[](targets.length);
        for (uint256 i = 0; i < targets.length; i++) {
            returned[i] = _execute(targets[i], values[i], data[i], signatures);
        }
        _ensureApprovedERC20SpentAll();
        return returned;
    }

    function _execute(
        address target,
        uint256 value,
        bytes memory data,
        Storage.Signatures memory signatures
    ) internal nonReentrant returns (bytes memory) {
        require(target != address(0), "invalid-target");
        require(value <= address(this).balance, "not-enough-balance");

        emit Executed(target, value, data);

        if (value > 0) {
            _addETHSpending(value, signatures.witnesses.length);
        }
        if (data.length > 0) {
            (bytes4 methodId, bytes memory args) = abi.decode(data, (bytes4, bytes));
            if (methodId == IERC20.transfer.selector) {
                (address to, uint256 amount) = abi.decode(args, (address, uint256));
                _addERC20Spending(target, amount, signatures.witnesses.length);
                IERC20(target).safeTransfer(to, value);
                return bytes("");
            } else if (methodId == IERC20.approve.selector) {
                (address to, uint256 amount) = abi.decode(args, (address, uint256));
                _addERC20Spending(target, amount, signatures.witnesses.length);
                _addERC20Approval(target, to);
                IERC20(target).approve(to, value);
                return bytes("");
            } else {
                // solhint-disable-next-line avoid-low-level-calls
                (bool success, bytes memory returned) = target.call{value: value}(data);
                if (success) {
                    return returned;
                } else {
                    if (returned.length > 0) {
                        assembly {
                            let returned_size := mload(returned)
                            revert(add(32, returned), returned_size)
                        }
                    } else {
                        revert("external-call-failed");
                    }
                }
            }
        } else {
            _addETHSpending(value, signatures.witnesses.length);
            payable(target).transfer(value);
            return bytes("");
        }
    }

    function _addERC20Approval(address token, address spender) private {
        if (spender == resolveENS(keccak256(abi.encodePacked("tx-relayer-v0")))) {
            return;
        }
        ERC20Approval storage approval = _approvals.push();
        approval.token = token;
        approval.spender = spender;
    }

    function _ensureApprovedERC20SpentAll() private {
        for (uint256 i = 0; i < _approvals.length; i++) {
            ERC20Approval storage approval = _approvals[i];
            require(
                IERC20(approval.token).allowance(address(this), approval.spender) == 0,
                "approved-erc20-not-spent"
            );
        }
        delete _approvals;
    }

    /**
     * @return a hash used to generate signature to properly call 'execute()'
     */
    function executeHash(
        address[] memory targets,
        uint256[] memory values,
        bytes[] memory data
    ) public override view returns (bytes32) {
        return
            keccak256(
                abi.encodePacked(
                    bytes1(0x19),
                    bytes1(0),
                    address(this),
                    _storage.nonce(),
                    this.execute.selector,
                    targets,
                    values,
                    abi.encode(data)
                )
            );
    }
}
","keccak256":"0xab15afc1bae8a170fa24b95e1ae16513f84dccc9225437c7b3f04a5bb4f9ad90","license":"MIT"},"contracts/wallet/mixins/Lockable.sol":{"content":"// SPDX-License-Identifier: MIT

pragma solidity ^0.6.8;
pragma experimental ABIEncoderV2;

import "./BaseMixin.sol";
import "./interfaces/ILockable.sol";

abstract contract Lockable is BaseMixin, ILockable {
    function _initialize() internal virtual {
        _storage.setSigningRequirements(this.lock.selector, false, 1);
        _storage.setSigningRequirements(
            this.unlock.selector,
            false,
            ((_storage.numberOfWitnesses() + 1) * 2) / 3
        );

        _storage.setSecurityPeriod(this.lock.selector, 0, new bytes4[](0));
        bytes4[] memory dependencies = new bytes4[](1);
        dependencies[0] = this.lock.selector;
        _storage.setSecurityPeriod(this.unlock.selector, 24 hours, dependencies);
    }

    function locked() public override view returns (bool) {
        return _storage.locked();
    }

    /**
     * @notice Locks the wallet
     *
     * Signature of at least one of the witnesses required
     */
    function lock(Storage.Signatures memory signatures)
        public
        override
        whenInitialized
        whenNotLocked
    {
        _ensureSignaturesValid(this.lock.selector, lockHash(), signatures);

        _storage.incrementNonce();
        _storage.updateLastExecutionTime(this.lock.selector);
        _storage.setLocked(true);

        emit Locked();
    }

    /**
     * @return a hash used to generate signature to properly call 'lock()'
     */
    function lockHash() public override view returns (bytes32) {
        return
            keccak256(
                abi.encodePacked(
                    bytes1(0x19),
                    bytes1(0),
                    address(this),
                    _storage.nonce(),
                    this.lock.selector
                )
            );
    }

    /**
     * @notice Unlocks the wallet
     *
     * Signatures of '((n + 1) * 2) / 3' required where 'n' is the number of the witnesses
     * Also, 24 hours needs to have passed after the lock has been called
     */
    function unlock(Storage.Signatures memory signatures)
        public
        override
        whenInitialized
        whenLocked
    {
        _ensureSecurityPeriodPassed(this.unlock.selector);
        _ensureSignaturesValid(this.unlock.selector, unlockHash(), signatures);

        _storage.incrementNonce();
        _storage.updateLastExecutionTime(this.unlock.selector);
        _storage.setLocked(false);

        emit Unlocked();
    }

    /**
     * @return a hash used to generate signature to properly call 'unlock()'
     */
    function unlockHash() public override view returns (bytes32) {
        return
            keccak256(
                abi.encodePacked(
                    bytes1(0x19),
                    bytes1(0),
                    address(this),
                    _storage.nonce(),
                    this.unlock.selector
                )
            );
    }
}
","keccak256":"0x421700513f0075bfa2b5bc8d981aedce2f059c965e3a3fc7c64ff40ef1134746","license":"MIT"},"contracts/wallet/mixins/Transferable.sol":{"content":"// SPDX-License-Identifier: MIT

pragma solidity ^0.6.8;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";

import "./BaseMixin.sol";
import "./interfaces/ITransferable.sol";
import "./interfaces/IAuthorizable.sol";

abstract contract Transferable is BaseMixin, ITransferable {
    using SafeERC20 for IERC20;
    using SafeMath for uint256;

    function _initialize() internal virtual {
        _storage.setSigningRequirements(this.transferETH.selector, true, 0);
        _storage.setSigningRequirements(this.transferERC20.selector, true, 0);

        bytes4[] memory dependencies = new bytes4[](1);
        dependencies[0] = IAuthorizable.transferOwnership.selector;
        _storage.setSecurityPeriod(this.transferETH.selector, 24 hours, dependencies);
        _storage.setSecurityPeriod(this.transferERC20.selector, 24 hours, dependencies);
    }

    /**
     * @notice How much an owner can spend with 0 witness
     *
     * For each signature of a witness is offered, limit is multiplied by 10
     */
    function minimumTransferLimitInUSD() public override view returns (uint256) {
        return _storage.minimumTransferLimitInUSD();
    }

    function transferCapacityResetPeriod() public override view returns (uint256) {
        return _storage.transferCapacityResetPeriod();
    }

    /**
     * @notice Transfer capacity available in USD
     *
     * 10**18 = 1 USD
     */
    function transferCapacityInUSD(uint256 numberOfWitnessSignatures)
        public
        override
        view
        returns (uint256)
    {
        return _storage.transferCapacityInUSD(numberOfWitnessSignatures);
    }

    function cumulativeSpendingInUSD(uint256 fromTimestamp) public override view returns (uint256) {
        return _storage.cumulativeSpendingInUSD(fromTimestamp);
    }

    /**
     * @notice Transfers 'value' amount of ETH to 'to'
     *
     * @param to receiver address
     * @param value amount of ETH
     */
    function transferETH(
        address payable to,
        uint256 value,
        Storage.Signatures memory signatures
    ) public override whenInitialized whenNotLocked {
        require(value <= address(this).balance, "not-enough-balance");

        _ensureSecurityPeriodPassed(this.transferETH.selector);
        _ensureSignaturesValid(this.transferETH.selector, transferETHHash(to, value), signatures);

        _storage.incrementNonce();
        _storage.updateLastExecutionTime(this.transferETH.selector);

        _addETHSpending(value, signatures.witnesses.length);
        to.transfer(value);

        emit ETHTransferred(to, value);
    }

    /**
     * @return a hash used to generate signature to properly call 'transferETH()'
     */
    function transferETHHash(address payable to, uint256 value)
        public
        override
        view
        returns (bytes32)
    {
        return
            keccak256(
                abi.encodePacked(
                    bytes1(0x19),
                    bytes1(0),
                    address(this),
                    _storage.nonce(),
                    this.transferETH.selector,
                    to,
                    value
                )
            );
    }

    /**
     * @notice Transfers 'value' amount of ERC20 'token' to 'to'
     *
     * @param token ERC20 address
     * @param to receiver address
     * @param value amount of ERC20
     */
    function transferERC20(
        address token,
        address to,
        uint256 value,
        Storage.Signatures memory signatures
    ) public override whenInitialized whenNotLocked {
        require(value <= IERC20(token).balanceOf(address(this)), "not-enough-balance");

        _ensureSecurityPeriodPassed(this.transferERC20.selector);
        _ensureSignaturesValid(
            this.transferERC20.selector,
            transferERC20Hash(token, to, value),
            signatures
        );

        _storage.incrementNonce();
        _storage.updateLastExecutionTime(this.transferERC20.selector);

        _addERC20Spending(token, value, signatures.witnesses.length);
        IERC20(token).safeTransfer(to, value);
    }

    /**
     * @return a hash used to generate signature to properly call 'transferERC20()'
     */
    function transferERC20Hash(
        address token,
        address to,
        uint256 value
    ) public override view returns (bytes32) {
        return
            keccak256(
                abi.encodePacked(
                    bytes1(0x19),
                    bytes1(0),
                    address(this),
                    _storage.nonce(),
                    this.transferERC20.selector,
                    token,
                    to,
                    value
                )
            );
    }
}
","keccak256":"0x322a07277a9c6fabb4c3cd62894837de367a1ea015007d18ff327cf2b7262330","license":"MIT"},"contracts/wallet/mixins/Upgradeable.sol":{"content":"// SPDX-License-Identifier: MIT

pragma solidity ^0.6.8;
pragma experimental ABIEncoderV2;

import "./BaseMixin.sol";
import "./interfaces/IUpgradeable.sol";
import "../../core/interfaces/IWalletRegistry.sol";

/**
 * @notice Implements https://eips.ethereum.org/EIPS/eip-1822
 * EIP-1822: Universal Upgradeable Proxy Standard (UUPS)
 */
abstract contract Upgradeable is BaseMixin, IUpgradeable {
    // keccak256("PROXIABLE") = 0xc5f16f0fcc639fa48a6947836d9850f504798523bf8c9a3a87d5876cf622bcf7
    bytes32
        private constant UUID = 0xc5f16f0fcc639fa48a6947836d9850f504798523bf8c9a3a87d5876cf622bcf7;

    function _initialize() internal virtual {
        _storage.setSigningRequirements(this.upgrade.selector, true, 0);
        _storage.setSecurityPeriod(this.upgrade.selector, 0, new bytes4[](0));
    }

    function proxiableUUID() public override pure returns (bytes32) {
        return UUID;
    }

    function implementation() public override view returns (address addr) {
        assembly {
            addr := sload(UUID)
        }
    }

    /**
     * @notice Upgrades to a new implementation
     *
     * Signature of the owner required
     */
    function upgrade(address impl, Storage.Signatures memory signatures)
        public
        override
        whenInitialized
    {
        _ensureSignaturesValid(this.upgrade.selector, upgradeHash(impl), signatures);

        IWalletRegistry registry = IWalletRegistry(
            resolveENS(keccak256(abi.encodePacked("wallet-registry-v0")))
        );
        require(registry.queryWithAddress(impl) != bytes32(0), "not-registered");
        require(UUID == Upgradeable(impl).proxiableUUID(), "not-upgradeable");

        _storage.incrementNonce();
        _storage.updateLastExecutionTime(this.upgrade.selector);

        assembly {
            sstore(UUID, impl)
        }

        emit Upgraded(impl);
    }

    /**
     * @return a hash used to generate signature to properly call 'upgrade()'
     */
    function upgradeHash(address impl) public override view returns (bytes32) {
        return
            keccak256(
                abi.encodePacked(
                    bytes1(0x19),
                    bytes1(0),
                    address(this),
                    _storage.nonce(),
                    this.upgrade.selector,
                    impl
                )
            );
    }
}
